import React from "react";
import "../css/Cell.css";

const Cell = ({color, rowIndex, colIndex}) => {

    return(
        <div className="Cell" style={{backgroundColor: color}}>
            {rowIndex} {colIndex}
        </div>
    );
}

export default React.memo(Cell);
